(3339, 'edd_sl_609ae11585be436291a4a56797acb272', 'a:2:{s:7:\"timeout\";i:1638774087;s:5:\"value\";s:6218:\"{\"new_version\":\"3.1.2\",\"stable_version\":\"3.1.2\",\"name\":\"Polylang Pro\",\"slug\":\"polylang\",\"url\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/?changelog=1\",\"last_updated\":\"2021-10-11 07:40:14\",\"homepage\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/\",\"package\":\"\",\"download_link\":\"\",\"sections\":{\"description\":\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\",\"changelog\":\"<h4> 3.1.2 (2021-10-11) <\\/h4>\\n<ul>\\n<li>Pro: Fix parent page not filtered by language in the block editor since WP 5.6<\\/li>\\n<li>Pro: Fix XLIFF mime type for PHP 7.0 and PHP 7.1<\\/li>\\n<li>Fix settings page displaying the media modules whne no language are defined<\\/li>\\n<li>Enforce Yoast SEO to use dynamic permalinks #882<\\/li>\\n<li>Yoast SEO: Fix static front page and blog page breadcrumb<\\/li>\\n<\\/ul>\\n<h4> 3.1.1 (2021-08-16) <\\/h4>\\n<ul>\\n<li>Pro: Fix a fatal error with The Events Calendar<\\/li>\\n<li>Allow to remove the cookie with the pll_cookie_expiration filter #905<\\/li>\\n<\\/ul>\\n<h4> 3.1 (2021-07-27) <\\/h4>\\n<ul>\\n<li>Add compatibility with WordPress 5.8<\\/li>\\n<li>Raise Minimum WordPress version to 5.4<\\/li>\\n<li>Pro: Allow to filter blocks by language in the widget block editor<\\/li>\\n<li>Pro: Allow to export and import XLIFF files for string translations<\\/li>\\n<li>Pro: Add the language switcher in the navigation block (experimental)<\\/li>\\n<li>Pro: Replace dashicons by svg icons in the block editor<\\/li>\\n<li>Pro: The Events Calendar: Add compatibility with Views V2 (only for sites using only one domain)<\\/li>\\n<li>Pro: Fix + icon displayed in the block editor sidebar when the user cannot create a translation<\\/li>\\n<li>Add a warning section to the site health for posts and terms without languages #825<\\/li>\\n<li>Require the simplexml extension in the site health if a wpml-config.xml is found #827<\\/li>\\n<li>Remove the information about the WPML compabitility mode in settings #843<\\/li>\\n<li>The browser preferred language detection is now deactivated by default<\\/li>\\n<li>The media are now untranslated by default<\\/li>\\n<li>Highlight the language filter in the admin toolbar when it\'s active #821<\\/li>\\n<li>Allow to query comments in multiple languages (just as posts and terms) #840<\\/li>\\n<li>Don\'t disable the translation input field in the classic metabox #841 Props Onatcer<\\/li>\\n<li>Optimize all images including flags #848 Props lowwebtech<\\/li>\\n<li>Don\'t redirect if WordPress doesn\'t validate the redirect url to avoid redirects to \\/wp-admin\\/ #879<\\/li>\\n<li>Fix media appearing to have a language after the language is changed in the media library grid view  #807<\\/li>\\n<li>Fix media not all deleted when bulk deleting from the grid view of the media library #830<\\/li>\\n<li>Fix when more than one language switcher are added to the same menu #853<\\/li>\\n<li>Fix PHP notice when adding a CPT archive link to a menu #868 Props davidwebca<\\/li>\\n<\\/ul>\\n<p>See <a href=\\\"https:\\/\\/plugins.svn.wordpress.org\\/polylang\\/trunk\\/changelog.txt\\\">changelog.txt<\\/a> for older changelog<\\/p>\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":{\"1x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\",\"2x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\"},\"msg\":\"No license key has been provided.\",\"stable_tag\":\"3.1.2\",\"tested\":\"5.8\",\"description\":[\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\"],\"changelog\":[\"<h4> 3.1.2 (2021-10-11) <\\/h4>\\n<ul>\\n<li>Pro: Fix parent page not filtered by language in the block editor since WP 5.6<\\/li>\\n<li>Pro: Fix XLIFF mime type for PHP 7.0 and PHP 7.1<\\/li>\\n<li>Fix settings page displaying the media modules whne no language are defined<\\/li>\\n<li>Enforce Yoast SEO to use dynamic permalinks #882<\\/li>\\n<li>Yoast SEO: Fix static front page and blog page breadcrumb<\\/li>\\n<\\/ul>\\n<h4> 3.1.1 (2021-08-16) <\\/h4>\\n<ul>\\n<li>Pro: Fix a fatal error with The Events Calendar<\\/li>\\n<li>Allow to remove the cookie with the pll_cookie_expiration filter #905<\\/li>\\n<\\/ul>\\n<h4> 3.1 (2021-07-27) <\\/h4>\\n<ul>\\n<li>Add compatibility with WordPress 5.8<\\/li>\\n<li>Raise Minimum WordPress version to 5.4<\\/li>\\n<li>Pro: Allow to filter blocks by language in the widget block editor<\\/li>\\n<li>Pro: Allow to export and import XLIFF files for string translations<\\/li>\\n<li>Pro: Add the language switcher in the navigation block (experimental)<\\/li>\\n<li>Pro: Replace dashicons by svg icons in the block editor<\\/li>\\n<li>Pro: The Events Calendar: Add compatibility with Views V2 (only for sites using only one domain)<\\/li>\\n<li>Pro: Fix + icon displayed in the block editor sidebar when the user cannot create a translation<\\/li>\\n<li>Add a warning section to the site health for posts and terms without languages #825<\\/li>\\n<li>Require the simplexml extension in the site health if a wpml-config.xml is found #827<\\/li>\\n<li>Remove the information about the WPML compabitility mode in settings #843<\\/li>\\n<li>The browser preferred language detection is now deactivated by default<\\/li>\\n<li>The media are now untranslated by default<\\/li>\\n<li>Highlight the language filter in the admin toolbar when it\'s active #821<\\/li>\\n<li>Allow to query comments in multiple languages (just as posts and terms) #840<\\/li>\\n<li>Don\'t disable the translation input field in the classic metabox #841 Props Onatcer<\\/li>\\n<li>Optimize all images including flags #848 Props lowwebtech<\\/li>\\n<li>Don\'t redirect if WordPress doesn\'t validate the redirect url to avoid redirects to \\/wp-admin\\/ #879<\\/li>\\n<li>Fix media appearing to have a language after the language is changed in the media library grid view  #807<\\/li>\\n<li>Fix media not all deleted when bulk deleting from the grid view of the media library #830<\\/li>\\n<li>Fix when more than one language switcher are added to the same menu #853<\\/li>\\n<li>Fix PHP notice when adding a CPT archive link to a menu #868 Props davidwebca<\\/li>\\n<\\/ul>\\n<p>See <a href=\\\"https:\\/\\/plugins.svn.wordpress.org\\/polylang\\/trunk\\/changelog.txt\\\">changelog.txt<\\/a> for older changelog<\\/p>\"],\"plugin\":\"polylang-pro\\/polylang.php\",\"id\":\"polylang-pro\\/polylang.php\"}\";}', 'no'),
