(3358, 'hyyan-wpi-flash-messages', 'a:2:{s:18:\"wpi-activate-error\";a:5:{s:2:\"id\";s:18:\"wpi-activate-error\";s:7:\"message\";s:606:\"<h3>\n    Hyyan WooCommerce Polylang Integration Plugin</h3>\n<p>\n    The plugin can not function correctly , the plugin requires\n        minimum plugin versions WooCommerce version 3 or higher and Polylang 2 or higher.\n        Please configure Polylang by adding a language before activating WooCommerce Polylang Integration.See also<a href=\"https://github.com/hyyan/woo-poly-integration/wiki/Installation\">Installation Guide</a>.<p>\n<hr>\nPlugins : <a href=\"https://wordpress.org/plugins/woocommerce/\">\n    WooCommerce V3.0.0</a>\n|\n<a href=\"https://wordpress.org/plugins/polylang/\">\n    Polylang V2.0.0</a>\n\";s:7:\"classes\";a:1:{i:0;s:5:\"error\";}s:7:\"persist\";b:1;s:9:\"displayed\";b:0;}s:10:\"pagechecks\";a:5:{s:2:\"id\";s:10:\"pagechecks\";s:7:\"message\";s:336:\"cart page did not have language - language set to  on page <a href=\"\">1968</a><br/>checkout page did not have language - language set to  on page <a href=\"\">1969</a><br/>myaccount page did not have language - language set to  on page <a href=\"\">1970</a><br/>shop page did not have language - language set to  on page <a href=\"\">1967</a>\";s:7:\"classes\";a:1:{i:0;s:7:\"updated\";}s:7:\"persist\";b:1;s:9:\"displayed\";b:0;}}', 'yes'),
