(1174, 1, '2013-01-05 11:00:20', '2013-01-05 18:00:20', 'Putting special characters in the title should have no adverse effect on the layout or functionality.\n\nSpecial characters in the post title have been known to cause issues with JavaScript when it is minified, especially in the admin when editing the post itself (ie. issues with metaboxes, media upload, etc.).\n<h2>Latin Character Tests</h2>\nThis is a test to see if the fonts used in this theme support basic Latin characters.\n<table>\n<tbody>\n<tr>\n<td>!</td>\n<td>\"</td>\n<td>#</td>\n<td>$</td>\n<td>%</td>\n<td>&amp;</td>\n<td>\'</td>\n<td>(</td>\n<td>)</td>\n<td>*</td>\n</tr>\n<tr>\n<td>+</td>\n<td>,</td>\n<td>-</td>\n<td>.</td>\n<td>/</td>\n<td>0</td>\n<td>1</td>\n<td>2</td>\n<td>3</td>\n<td>4</td>\n</tr>\n<tr>\n<td>5</td>\n<td>6</td>\n<td>7</td>\n<td>8</td>\n<td>9</td>\n<td>:</td>\n<td>;</td>\n<td>&gt;</td>\n<td>=</td>\n<td>&lt;</td>\n</tr>\n<tr>\n<td>?</td>\n<td>@</td>\n<td>A</td>\n<td>B</td>\n<td>C</td>\n<td>D</td>\n<td>E</td>\n<td>F</td>\n<td>G</td>\n<td>H</td>\n</tr>\n<tr>\n<td>I</td>\n<td>J</td>\n<td>K</td>\n<td>L</td>\n<td>M</td>\n<td>N</td>\n<td>O</td>\n<td>P</td>\n<td>Q</td>\n<td>R</td>\n</tr>\n<tr>\n<td>S</td>\n<td>T</td>\n<td>U</td>\n<td>V</td>\n<td>W</td>\n<td>X</td>\n<td>Y</td>\n<td>Z</td>\n<td>[</td>\n<td>\\</td>\n</tr>\n<tr>\n<td>]</td>\n<td>^</td>\n<td>_</td>\n<td>`</td>\n<td>a</td>\n<td>b</td>\n<td>c</td>\n<td>d</td>\n<td>e</td>\n<td>f</td>\n</tr>\n<tr>\n<td>g</td>\n<td>h</td>\n<td>i</td>\n<td>j</td>\n<td>k</td>\n<td>l</td>\n<td>m</td>\n<td>n</td>\n<td>o</td>\n<td>p</td>\n</tr>\n<tr>\n<td>q</td>\n<td>r</td>\n<td>s</td>\n<td>t</td>\n<td>u</td>\n<td>v</td>\n<td>w</td>\n<td>x</td>\n<td>y</td>\n<td>z</td>\n</tr>\n<tr>\n<td>{</td>\n<td>|</td>\n<td>}</td>\n<td>~</td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n</tr>\n</tbody>\n</table>', 'Markup: Title With Special Characters ~`!@#$%^&*()-_=+{}[]/\\;:\'\"?,.>', '', 'publish', 'closed', 'closed', '', 'title-with-special-characters', '', '', '2013-01-05 11:00:20', '2013-01-05 18:00:20', '', 0, 'http://wptest.io/demo/?p=867', 0, 'post', '', 0),
(1175, 1, '2009-10-05 12:00:59', '2009-10-05 19:00:59', '<h2>Title should not overflow the content area</h2>\n\nA few things to check for:\n<ul>\n	<li>Non-breaking text in the title, content, and comments should have no adverse effects on layout or functionality.</li>\n	<li>Check the browser window / tab title.</li>\n	<li>If you are a plugin or widget developer, check that this text does not break anything.</li>\n</ul>\n\nThe following CSS properties will help you support non-breaking text.\n\n<pre>-ms-word-wrap: break-word;\nword-wrap: break-word;</pre>\n&nbsp;', 'Taumatawhakatangihangakoauauotamateaturipukakapikimaungahoronukupokaiwhenuakitanatahu', '', 'publish', 'closed', 'closed', '', 'title-should-not-overflow-the-content-area', '', '', '2009-10-05 12:00:59', '2009-10-05 19:00:59', '', 0, 'http://wptest.io/demo/?p=877', 0, 'post', '', 0),
(1176, 1, '2013-01-09 09:00:39', '2013-01-09 16:00:39', '<h3>Default</h3>\nThis is a paragraph. It should not have any alignment of any kind. It should just flow like you would normally expect. Nothing fancy. Just straight up text, free flowing, with love. Completely neutral and not picking a side or sitting on the fence. It just is. It just freaking is. It likes where it is. It does not feel compelled to pick a side. Leave him be. It will just be better that way. Trust me.\n<h3>Left Align</h3>\n<p style=\"text-align:left;\">This is a paragraph. It is left aligned. Because of this, it is a bit more liberal in it\'s views. It\'s favorite color is green. Left align tends to be more eco-friendly, but it provides no concrete evidence that it really is. Even though it likes share the wealth evenly, it leaves the equal distribution up to justified alignment.</p>\n\n<h3>Center Align</h3>\n<p style=\"text-align:center;\">This is a paragraph. It is center aligned. Center is, but nature, a fence sitter. A flip flopper. It has a difficult time making up its mind. It wants to pick a side. Really, it does. It has the best intentions, but it tends to complicate matters more than help. The best you can do is try to win it over and hope for the best. I hear center align does take bribes.</p>\n\n<h3>Right Align</h3>\n<p style=\"text-align:right;\">This is a paragraph. It is right aligned. It is a bit more conservative in it\'s views. It\'s prefers to not be told what to do or how to do it. Right align totally owns a slew of guns and loves to head to the range for some practice. Which is cool and all. I mean, it\'s a pretty good shot from at least four or five football fields away. Dead on. So boss.</p>\n\n<h3>Justify Align</h3>\n<p style=\"text-align:justify;\">This is a paragraph. It is justify aligned. It gets really mad when people associate it with Justin Timberlake. Typically, justified is pretty straight laced. It likes everything to be in it\'s place and not all cattywampus like the rest of the aligns. I am not saying that makes it better than the rest of the aligns, but it does tend to put off more of an elitist attitude.</p>', 'Markup: Text Alignment', '', 'publish', 'closed', 'closed', '', 'markup-text-alignment', '', '', '2013-01-09 09:00:39', '2013-01-09 16:00:39', '', 0, 'http://wptest.io/demo/?p=895', 0, 'post', '', 0),
(1177, 1, '2013-01-10 20:15:40', '2013-01-11 03:15:40', 'Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let\'s get started.\n\nOn the topic of alignment, it should be noted that users can choose from the options of <em>None</em>, <em>Left</em>, <em>Right, </em>and <em>Center</em>. In addition, they also get the options of <em>Thumbnail</em>, <em>Medium</em>, <em>Large</em> &amp; <em>Fullsize</em>. Be sure to try this page in RTL mode and it should look the same as LTR. \n<p><img class=\"size-full wp-image-906 aligncenter\" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-580x300-1.jpg\" width=\"580\" height=\"300\" /></p>\nThe image above happens to be <em><strong>centered</strong></em>.\n\n<img class=\"size-full wp-image-904 alignleft\" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-150x150-1.jpg\" width=\"150\" height=\"150\" /> The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. \n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n<img class=\"alignnone  wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-1200x4002-1.jpg\" width=\"1200\" height=\"400\" />\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class=\"aligncenter  wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-1200x4002-1.jpg\" width=\"1200\" height=\"400\" />\n\nAnd we try the large image again, with the center alignment since that sometimes is a problem. The image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class=\"size-full wp-image-905 alignright\" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-300x200-1.jpg\" width=\"300\" height=\"200\" />\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd just when you thought we were done, we\'re going to do them all over again with captions!\n\n[caption id=\"attachment_906\" align=\"aligncenter\" width=\"580\"]<img class=\"size-full wp-image-906  \" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-580x300-1.jpg\" width=\"580\" height=\"300\" /> Look at 580x300 getting some <a title=\"Image Settings\" href=\"https://en.support.wordpress.com/images/image-settings/\">caption</a> love.[/caption]\n\nThe image above happens to be <em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.\n\n[caption id=\"attachment_904\" align=\"alignleft\" width=\"150\"]<img class=\"size-full wp-image-904  \" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-150x150-1.jpg\" width=\"150\" height=\"150\" /> Bigger caption than the image usually is.[/caption]\n\nThe rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. \n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n[caption id=\"attachment_907\" align=\"alignnone\" width=\"1200\"]<img class=\" wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-1200x4002-1.jpg\" width=\"1200\" height=\"400\" /> Comment for massive image for your eyeballs.[/caption]\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n[caption id=\"attachment_907\" align=\"aligncenter\" width=\"1200\"]<img class=\" wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-1200x4002-1.jpg\" width=\"1200\" height=\"400\" /> This massive image is centered.[/caption]\n\nAnd again with the big image centered. The image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n[caption id=\"attachment_905\" align=\"alignright\" width=\"300\"]<img class=\"size-full wp-image-905 \" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-300x200-1.jpg\" width=\"300\" height=\"200\" /> Feels good to be right all the time.[/caption]\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd that\'s a wrap, yo! You survived the tumultuous waters of alignment. Image alignment achievement unlocked! One last thing: The last item in this post\'s content is a thumbnail floated right. Make sure any elements after the content are clearing properly.\n\n<img class=\"alignright size-thumbnail wp-image-827\" title=\"Camera\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2010/08/manhattansummer.jpg\" alt=\"\" width=\"160\" />', 'Markup: Image Alignment', '', 'publish', 'closed', 'closed', '', 'markup-image-alignment', '', '', '2013-01-10 20:15:40', '2013-01-11 03:15:40', '', 0, 'http://wptest.io/demo/?p=903', 0, 'post', '', 0),
(1178, 1, '2013-01-11 20:22:19', '2013-01-12 03:22:19', '<strong>Headings</strong>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote cite=\"https://developer.mozilla.org/en-US/docs/Web/HTML/Element/blockquote\"><p>The <strong>HTML <code>&lt;blockquote&gt;</code> Element</strong> (or <em>HTML Block Quotation Element</em>) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see <a href=\"https://developer.mozilla.org/en-US/docs/HTML/Element/blockquote#Notes\">Notes</a> for how to change it). A URL for the source of the quotation may be given using the <strong>cite</strong> attribute, while a text representation of the source can be given using the <a href=\"https://developer.mozilla.org/en-US/docs/Web/HTML/Element/cite\" title=\"The HTML Citation Element &lt;cite&gt; represents a reference to a creative work. It must include the title of a work or a URL reference, which may be in an abbreviated form according to the conventions used for the addition of citation metadata.\"><code>&lt;cite&gt;</code></a> element.</p></blockquote>\n<cite>multiple contributors</cite> - MDN HTML element reference - blockquote\n<h2>Tables</h2>\n<table>\n<thead>\n<tr>\n<th>Employee</th>\n<th>Salary</th>\n<th></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<th><a href=\"http://example.org/\">John Doe</a></th>\n<td>$1</td>\n<td>Because that\'s all Steve Jobs needed for a salary.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Doe</a></th>\n<td>$100K</td>\n<td>For all the blogging she does.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Fred Bloggs</a></th>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Bloggs</a></th>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher \"Big Black\" Boykins, \"Do Work\" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I\'ll let Bill O\'Reilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd></dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol start=\"8\">\n 	<li>List item one -start at 8\n<ol>\n 	<li>List item one\n<ol reversed=\"reversed\">\n 	<li>List item one -reversed attribute</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"https://en.support.wordpress.com/code/\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title=\"WordPress Foundation\" href=\"https://wordpressfoundation.org/\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for \"seriously\".\n\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for \"for the win\".\n\n<strong>Big Tag</strong> (<em>deprecated in HTML5</em>)\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n\"Code is poetry.\" --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nThis tag styles blocks of code.\n<code>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n	and here\'s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\n}</code>\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del cite=\"deleted it\">strike out text</del>, but this tag is <em>recommended</em> supported in HTML5 (use the <code>&lt;s&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> <i>text</i>.\n\n<strong>Horizontal Rule Tag</strong>\n\n<hr />\n\nThis sentence is following a <code>&lt;hr /&gt;</code> tag.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins cite=\"inserted it\">inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag is for preserving whitespace as typed, such as in poetry or ASCII art.\n<h2>The Road Not Taken</h2>\n<pre>\n<cite>Robert Frost</cite>\n\n\n  Two roads diverged in a yellow wood,\n  And sorry I could not travel both          (\\_/)\n  And be one traveler, long I stood         (=\'.\'=)\n  And looked down one as far as I could     (\")_(\")\n  To where it bent in the undergrowth;\n\n  Then took the other, as just as fair,\n  And having perhaps the better claim,          |\\_/|\n  Because it was grassy and wanted wear;       / @ @ \\\n  Though as for that the passing there        ( &gt; º &lt; )\n  Had worn them really about the same,         `&gt;&gt;x&lt;&lt;´\n                                               /  O  \\\n  And both that morning equally lay\n  In leaves no step had trodden black.\n  Oh, I kept the first for another day!\n  Yet knowing how way leads on to way,\n  I doubted if I should ever come back.\n\n  I shall be telling this with a sigh\n  Somewhere ages and ages hence:\n  Two roads diverged in a wood, and I—\n  I took the one less traveled by,\n  And that has made all the difference.\n\n\n  and here\'s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\n</pre>\n<strong>Quote Tag</strong> for short, inline quotes\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strike Tag</strong> (<em>deprecated in HTML5</em>) and <strong>S Tag</strong>\n\nThis tag shows <strike>strike-through</strike> <s>text</s>.\n\n<strong>Small Tag</strong>\n\nThis tag shows <small>smaller<small> text.</small></small>\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.</strong></strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the \"2\" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Albert Einstein\'s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag </strong>(<em>obsolete in HTML5</em>)\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Underline Tag</strong> <em>deprecated in HTML 4, re-introduced in HTML5 with other semantics</em>\n\nThis tag shows <u>underlined text</u>.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.', 'Markup: HTML Tags and Formatting', '', 'publish', 'closed', 'closed', '', 'markup-html-tags-and-formatting', '', '', '2013-01-11 20:22:19', '2013-01-12 03:22:19', '', 0, 'http://wptest.io/demo/?p=919', 0, 'post', '', 0),
(1179, 1, '2011-03-15 15:47:16', '2011-03-15 22:47:16', 'https://twitter.com/nacin/status/319508408669708289\n\nThis post tests WordPress\' <a title=\"Twitter Embeds\" href=\"https://en.support.wordpress.com/twitter/twitter-embeds/\" target=\"_blank\" rel=\"noopener\">Twitter Embeds</a> feature.', 'Media: Twitter Embeds', '', 'publish', 'closed', 'closed', '', 'media-twitter-embeds', '', '', '2011-03-15 15:47:16', '2011-03-15 22:47:16', '', 0, 'http://wptest.io/demo/?p=1027', 0, 'post', '', 0),
(1241, 1, '2012-01-07 07:07:21', '2012-01-07 14:07:21', 'This is a sticky post.\n\nThere are a few things to verify:\n<ul>\n	<li>The sticky post should be distinctly recognizable in some way in comparison to normal posts. You can style the <code>.sticky</code> class if you are using the <a title=\"WordPress post_class() Function\" href=\"https://developer.wordpress.org/reference/functions/post_class/\" target=\"_blank\" rel=\"noopener\">post_class()</a> function to generate your post classes, which is a best practice.</li>\n	<li>They should show at the very top of the blog index page, even though they could be several posts back chronologically.</li>\n	<li>They should still show up again in their chronologically correct postion in time, but without the sticky indicator.</li>\n	<li>If you have a plugin or widget that lists popular posts or comments, make sure that this sticky post is not always at the top of those lists unless it really is popular.</li>\n</ul>', 'Template: Sticky', '', 'publish', 'closed', 'closed', '', 'template-sticky', '', '', '2012-01-07 07:07:21', '2012-01-07 14:07:21', '', 0, 'http://wptest.io/demo/?p=1241', 0, 'post', '', 0),
(1446, 1, '2012-03-14 09:49:22', '2012-03-14 16:49:22', 'This is the post content. It should be displayed in place of the auto-generated excerpt in single-page views. Archive-index pages should display an auto-generated excerpt of this content. Depending on Theme-defined filters, the length of the auto-generated excerpt will vary from Theme-to-Theme. The default length for auto-generated excerpts is 55 words, so to test the excerpt auto-generation, this post must have more than 55 words.\n\nBe sure to test the formatting of the auto-generated excerpt, to ensure that it doesn\'t create any layout problems. Also, ensure that any filters applied to the excerpt, such as <code>excerpt_length</code> and <code>excerpt_more</code>, display properly.', 'Template: Excerpt (Generated)', '', 'publish', 'closed', 'closed', '', 'template-excerpt-generated', '', '', '2012-03-14 09:49:22', '2012-03-14 16:49:22', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1446', 0, 'post', '', 0),
(1778, 1, '2018-11-01 07:10:43', '2018-11-01 07:10:43', '<!-- wp:paragraph -->\n<p>The Common category includes the following blocks:<em> Paragraph, image, headings, list, gallery, quote, audio, cover, video.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The paragraph block is the default block type.&nbsp; It should not have any alignment of any kind. It should just flow like you would normally expect. Nothing fancy. Just straight up text, free flowing, with love.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This paragraph is left aligned.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"right\"} -->\n<p class=\"has-text-align-right\"><em>This italic paragraph is right aligned.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"dropCap\":true,\"fontSize\":\"medium\"} -->\n<p class=\"has-drop-cap has-medium-font-size\"><strong>Neither of these paragraphs care about politics, but this one is bold, medium sized and has a drop cap.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">This paragraph is centered. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">This paragraph prefers Jazz over Justin Timberlake. It also uses the small font size.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\">This paragraph has something important to say:&nbsp; It has a large font size, which defaults to 36px.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customFontSize\":46} -->\n<p style=\"font-size:46px\">The huge text size defaults to 46px, but the size can be customized.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\",\"customBackgroundColor\":\"#cf2e2e\"} -->\n<p style=\"background-color:#cf2e2e\" class=\"has-text-color has-background has-very-light-gray-color\">This paragraph is colorful, with a red background and white text (maybe).  Colored blocks should have a high enough contrast, so that the text is readable. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customTextColor\":\"#1e0566\"} -->\n<p style=\"color:#1e0566\" class=\"has-text-color\"><strong>Below this block, you will see a single image with a circle mask applied.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":968,\"sizeSlug\":\"full\",\"className\":\"is-style-circle-mask\"} -->\n<figure class=\"wp-block-image size-full is-style-circle-mask\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/03/image-alignment-150x150-1.jpg\" alt=\"Image Alignment 150x150\" class=\"wp-image-968\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>H1 Heading</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>H2 Heading</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>H3 Heading</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>H4 Heading</h4>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>H5 Heading</h5>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6>H6 Heading</h6>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Ordered list</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true,\"start\":0} -->\n<ol start=\"0\"><li>The software should be licensed under the&nbsp;<a href=\"http://www.gnu.org/copyleft/gpl.html\">GNU Public License</a>.</li><li>The software should be freely available to anyone to use for any purpose, and without permission.</li><li>The software should be open to modifications.<ol><li>Any modifications should be freely distributable at no cost and without permission from its creators.</li></ol></li><li>The software should provide a framework for translation to make it globally accessible to speakers of all languages.</li><li>The software should provide a framework for extensions so modifications and enhancements can be made without modifying core code</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Unordered list</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>One</li><li>Two</li><li>Three<ul><li>Four</li></ul></li><li>Five</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:gallery {\"ids\":[\"769\",\"768\",\"767\",\"770\",\"807\",\"766\"],\"columns\":2} -->\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/img_0747.jpg\" alt=\"Brazil Beach\" data-id=\"769\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/img_0747/\" class=\"wp-image-769\"/><figcaption class=\"blocks-gallery-item__caption\">Jericoacoara Ceara Brasil</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/img_0513-1.jpg\" alt=\"Huatulco Coastline\" data-id=\"768\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/alas-i-have-found-my-shangri-la/\" class=\"wp-image-768\"/><figcaption class=\"blocks-gallery-item__caption\">Sunrise over the coast in Huatulco, Oaxaca, Mexico</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/windmill.jpg\" alt=\"Windmill\" data-id=\"767\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery//dcf-1-0/\" class=\"wp-image-767\"/><figcaption class=\"blocks-gallery-item__caption\">Windmill shrouded in fog at a farm outside of Walker, Iowa</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/img_0767.jpg\" alt=\"Huatulco Coastline\" data-id=\"770\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/img_0767/\" class=\"wp-image-770\"/><figcaption class=\"blocks-gallery-item__caption\">Coastline in Huatulco, Oaxaca, Mexico</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2012/06/dsc20040724_152504_532.jpg\" alt=\"\" data-id=\"807\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/dsc20040724_152504_532-2/\" class=\"wp-image-807\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/michelle_049.jpg\" alt=\"Big Sur\" data-id=\"766\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/michelle_049/\" class=\"wp-image-766\"/><figcaption class=\"blocks-gallery-item__caption\">Beach at Big Sur, CA</figcaption></figure></li></ul><figcaption class=\"blocks-gallery-caption\">images are not linked</figcaption></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Quote</p><cite>Cite</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:audio {\"id\":821} -->\n<figure class=\"wp-block-audio\"><audio controls src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/originaldixielandjazzbandwithalbernard-stlouisblues.mp3\"></audio></figure>\n<!-- /wp:audio -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc04563.jpg\",\"id\":759,\"minHeight\":274} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc04563.jpg);min-height:274px\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">Cover block with background image</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>The file block has a setting that lets us show or hide a download button with editable text: </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:file {\"id\":1690,\"href\":\"https://wpthemetestdata.files.wordpress.com/2018/11/file_block.pdf\"} -->\n<div class=\"wp-block-file\"><a href=\"https://wpthemetestdata.files.wordpress.com/2018/11/file_block.pdf\">File Block PDF</a><a href=\"https://wpthemetestdata.files.wordpress.com/2018/11/file_block.pdf\" class=\"wp-block-file__button\" download>Download</a></div>\n<!-- /wp:file -->\n\n<!-- wp:file {\"id\":1690,\"href\":\"https://wpthemetestdata.files.wordpress.com/2018/11/file_block.pdf\",\"showDownloadButton\":false} -->\n<div class=\"wp-block-file\"><a href=\"https://wpthemetestdata.files.wordpress.com/2018/11/file_block.pdf\">File Block PDF</a></div>\n<!-- /wp:file -->\n\n<!-- wp:paragraph -->\n<p>Video blocks have settings for showing and hiding the playback controls. Use autoplay and playback controls responsibly. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:video {\"id\":1690} -->\n<figure class=\"wp-block-video\"><video controls loop src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\"></video><figcaption>This is a video block caption.</figcaption></figure>\n<!-- /wp:video -->\n\n<!-- wp:paragraph -->\n<p>The video block below is muted and has a poster image that displays before the video starts:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:video {\"id\":1690} -->\n<figure class=\"wp-block-video\"><video controls muted poster=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc20050727_091048_222.jpg\" src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\"></video></figure>\n<!-- /wp:video -->\n', 'Block category: Common', '', 'publish', 'open', 'open', '', 'block-category-common', '', '', '2018-11-01 07:10:43', '2018-11-01 07:10:43', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1730', 0, 'post', '', 0),
(1779, 1, '2018-11-01 06:03:22', '2018-11-01 06:03:22', '<!-- wp:paragraph -->\n<p>The formatting category includes the following blocks:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>The code block starts with\n&lt;!-- wp:code -->\n&lt;?php echo \'Hello World\'; ?>\n</code></pre>\n<!-- /wp:code -->\n\n<p>The classic block can have <em>almost</em> anything in it.</p>\n<hr />\n<h6>a heading</h6>\n\n<!-- wp:html -->\n<div style=\"width: 45%\">The custom HTML block lets you put HTML that isn\'t configured like blocks in it. (this div has a width of 45%)</div>\n<!-- /wp:html -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">The preformatted block.<br><br>The Road Not Taken<br><br>Robert Frost <br>Two roads diverged in a yellow wood,<br>And sorry I could not travel both          (\\_/)  <br>And be one traveler, long I stood         (=\'.\'=)  <br>And looked down one as far as I could     (\")_(\")  <br>To where it bent in the undergrowth; <br><br>Then took the other, as just as fair,  <br>And having perhaps the better claim,          |\\_/|  <br>Because it was grassy and wanted wear;       / @ @ \\  <br>Though as for that the passing there        ( &gt; º &lt; )  <br>Had worn them really about the same,         `&gt;&gt;x&lt;&lt;´  <br>                                             /  O  \\  <br>And both that morning equally lay  <br>In leaves no step had trodden black.  <br>Oh, I kept the first for another day!  <br>Yet knowing how way leads on to way,  <br>I doubted if I should ever come back.  <br>I shall be telling this with a sigh  <br>Somewhere ages and ages hence:  <br>Two roads diverged in a wood, and I—  <br>I took the one less traveled by,  <br>And that has made all the difference.  <br><br><br><br>and here\'s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;<br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>The pull quote can be aligned or wide or neither.</p><cite>Theme Reviewer</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table class=\"\"><tbody><tr><td>The table block</td><td>This is the default style.</td></tr><tr><td></td><td>The cell next to this is empty.</td></tr><tr><td>Cell #5<br></td><td>Cell #6</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:table {\"hasFixedLayout\":true,\"className\":\"is-style-stripes\"} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-fixed-layout\"><tbody><tr><td>This is the striped style.</td><td>This row should have a background color.</td></tr><tr><td>The cell next to this is empty.</td><td><br><br></td></tr><tr><td></td><td>This table has fixed width table cells.<br></td></tr><tr><td><br>Make sure that the text wraps correctly.<br><br></td><td></td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:verse -->\n<pre class=\"wp-block-verse\">The Verse block<br><br>A block for haiku? <br>  Why not? <br>    Blocks for all the things!</pre>\n<!-- /wp:verse -->', 'Block category: Formatting', '', 'publish', 'open', 'open', '', 'blocks-formatting', '', '', '2018-11-01 06:03:22', '2018-11-01 06:03:22', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1732', 0, 'post', '', 0),
(1780, 1, '2018-11-01 06:08:25', '2018-11-01 06:08:25', '<!-- wp:group {\"customBackgroundColor\":\"#d8f6ec\"} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#d8f6ec\"><div class=\"wp-block-group__inner-container\"><!-- wp:paragraph -->\n<p>The Layout Elements category includes the following blocks: <em>Group, Button, Columns, Media &amp; Text, separator, spacer, read more, and page break.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This group block has a light green background color.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\">A button</a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>The read more block should be right below this text, but only on list pages of themes that show the full content. It won\'t show on the single page or on themes showing excerpts.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:more -->\n<!--more-->\n<!-- /wp:more -->\n\n<!-- wp:columns {\"className\":\"has-4-columns\"} -->\n<div class=\"wp-block-columns has-4-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>The columns:</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column two.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column three.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column four.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:media-text {\"mediaId\":757,\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dcp_2082.jpg\" alt=\"Boardwalk\" class=\"wp-image-757\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\",\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\">Media &amp;Text</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For displaying media and text next to each other. By default, the media is to the left.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"align\":\"full\",\"customBackgroundColor\":\"#ebf5fe\",\"mediaPosition\":\"right\",\"mediaId\":755,\"mediaType\":\"image\",\"isStackedOnMobile\":true} -->\n<div class=\"wp-block-media-text alignfull has-media-on-the-right has-background is-stacked-on-mobile\" style=\"background-color:#ebf5fe\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/100_5540.jpg\" alt=\"Golden Gate Bridge\" class=\"wp-image-755\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\",\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\">This time our block is full width, and the image is to the right.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The background color is a pale blue.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:paragraph -->\n<p>Test to make sure that the editor and the front match.&nbsp;To test the <em>Stack on mobile </em>setting, reduce the browser window width.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The control these settings, the block uses the css classes \"has-media-on-the-right\" and \"is-stacked-on-mobile\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The separator has three styles: default, wide line, and dots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"className\":\"is-style-dots\"} -->\n<hr class=\"wp-block-separator is-style-dots\"/>\n<!-- /wp:separator -->\n\n<!-- wp:paragraph -->\n<p>The spacer block has a default height of 100 pixels:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>And finally, the page break:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:nextpage -->\n<!--nextpage-->\n<!-- /wp:nextpage -->\n\n<!-- wp:paragraph -->\n<p>This paragraph block is on page two, after the page break.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://wpthemetestdata.wordpress.com/2018/11/03/block-button/\">another button</a></div>\n<!-- /wp:button -->', 'Block category: Layout Elements', '', 'publish', 'open', 'open', '', 'blocks-layout-elements', '', '', '2018-11-01 06:08:25', '2018-11-01 06:08:25', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1734', 0, 'post', '', 0),
(1781, 1, '2018-11-01 06:18:46', '2018-11-01 06:18:46', '\n    <!-- wp:paragraph -->\n<p>This post tests various embed blocks:</p>\n<!-- /wp:paragraph -->\n    \n<!-- wp:core-embed/twitter {\"url\":\"https://twitter.com/WordPress/status/1057136472321613824\",\"type\":\"rich\",\"providerNameSlug\":\"twitter\",\"align\":\"wide\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-twitter alignwide wp-block-embed is-type-rich is-provider-twitter\"><div class=\"wp-block-embed__wrapper\">\nhttps://twitter.com/WordPress/status/1057136472321613824\n</div><figcaption>Twitter,&nbsp; wide width</figcaption></figure>\n<!-- /wp:core-embed/twitter -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://youtu.be/ex8fMxXJDJw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://youtu.be/ex8fMxXJDJw\n</div><figcaption>YouTube<br></figcaption></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:core-embed/facebook {\"url\":\"https://www.facebook.com/6427302910/posts/10156380423617911/\",\"type\":\"rich\",\"providerNameSlug\":\"facebook\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-facebook wp-block-embed is-type-rich is-provider-facebook\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.facebook.com/6427302910/posts/10156380423617911/\n</div></figure>\n<!-- /wp:core-embed/facebook -->\n\n<!-- wp:core-embed/instagram {\"url\":\"https://www.instagram.com/p/BpmueLLgEn_/?utm_source=ig_share_sheet\\u0026igshid=1hcxphic7p9e2\",\"type\":\"rich\",\"providerNameSlug\":\"instagram\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-instagram wp-block-embed is-type-rich is-provider-instagram\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.instagram.com/p/BpmueLLgEn_/?utm_source=ig_share_sheet&amp;igshid=1hcxphic7p9e2\n</div></figure>\n<!-- /wp:core-embed/instagram -->\n\n<!-- wp:core-embed/wordpress-tv {\"url\":\"https://wordpress.tv/2018/10/14/kjell-reigstad-allan-cole-how-we-made-our-first-gutenberg-powered-theme/\",\"type\":\"video\",\"providerNameSlug\":\"\",\"align\":\"full\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-wordpress-tv alignfull wp-block-embed is-type-video wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://wordpress.tv/2018/10/14/kjell-reigstad-allan-cole-how-we-made-our-first-gutenberg-powered-theme/\n</div><figcaption>WordPress TV, full width<br></figcaption></figure>\n<!-- /wp:core-embed/wordpress-tv -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Block category: Embeds', '', 'publish', 'open', 'open', '', 'blocks-embeds', '', '', '2018-11-01 06:18:46', '2018-11-01 06:18:46', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1738', 0, 'post', '', 0),
(1782, 1, '2018-11-01 06:14:47', '2018-11-01 06:14:47', '\n    <!-- wp:paragraph -->\n<p>The shortcode widget:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n[gallery columns=2 ids=\"770,771\"]\n<!-- /wp:shortcode -->\n\n<!-- wp:paragraph -->\n<p>The Archive Widget:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:archives {\"className\":\"extraclass\",\"showPostCounts\":true} /-->\n\n<!-- wp:paragraph -->\n<p>The same Archive widget but as a dropdown:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:archives {\"displayAsDropdown\":true,\"showPostCounts\":true} /-->\n\n<!-- wp:calendar /-->\n\n<!-- wp:paragraph -->\n<p>The Category widget block has an additional option for showing category hierarchies:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:categories {\"displayAsDropdown\":true,\"showHierarchy\":true,\"showPostCounts\":true} /-->\n\n<!-- wp:paragraph -->\n<p>The Latest Comments widget can display or hide the avatars, the date, and the comment excerpt:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:latest-comments {\"commentsToShow\":4} /-->\n\n<!-- wp:paragraph -->\n<p>Here is an example of the Comments widget with all the options disabled. The number of comments has been reduced to two.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:latest-comments {\"commentsToShow\":2,\"displayAvatar\":false,\"displayDate\":false,\"displayExcerpt\":false} /-->\n\n<!-- wp:paragraph -->\n<p>And here is the Latest Posts widget in the list view, with dates:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:latest-posts {\"displayPostDate\":true} /-->\n\n<!-- wp:paragraph -->\n<p>Grid view, now sorted from A -Z.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:latest-posts {\"postLayout\":\"grid\",\"order\":\"asc\",\"orderBy\":\"title\"} /-->\n\n<!-- wp:paragraph -->\n<p>You can also change the number of columns used to display the latest posts. The block below only displays posts from the Block category:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:latest-posts {\"categories\":\"6\",\"postsToShow\":10,\"displayPostDate\":true,\"postLayout\":\"grid\",\"columns\":5} /-->\n\n<!-- wp:paragraph -->\n<p>Search widget:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:search /-->\n\n<!-- wp:paragraph -->\n<p>Tag Cloud widget:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:tag-cloud /-->\n\n<!-- wp:paragraph -->\n<p>RSS Feed widget:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:rss {\"feedURL\":\"https://make.wordpress.org/themes/feed/\"} /-->\n    ', 'Block category: Widgets', '', 'publish', 'open', 'open', '', 'blocks-widgets', '', '', '2018-11-01 06:14:47', '2018-11-01 06:14:47', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1736', 0, 'post', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1783, 1, '2018-11-02 12:10:00', '2018-11-02 12:10:00', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This page tests how the theme displays the columns block. The first block tests a two column block with paragraphs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is the <strong>second</strong> column. It should align next to the first column. Reduce the browser window width to test the responsiveness.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is the second column block. It has <strong>3</strong> columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Paragraph 2 is in the middle.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Paragraph 3 is in the last column.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p> The third column block has <strong>4</strong> columns. Make sure that all the text is visible and that it is not cut off. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Now the columns are getting narrower.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>The margins between the columns should be wide enough,</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>so that the content of the columns does not run into or overlap each other.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column one.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column two.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column three.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column four.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column <strong>five</strong>.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>To change the number of columns, select the column block to open the settings panel. You can show up to 6 columns. If the theme has support for wide align, you can also set the alignments to wide and full width.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is a column block with six columns, and no alignment:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column one.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column two.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column three.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column four.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column five.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column six.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>Next is a 3 column block, with a wide alignment:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column one.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column two.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Column three.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>And here is a two column block with full width, and a longer text. Make sure that the text wraps correctly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"has-2-columns\"} -->\n<div class=\"wp-block-columns alignfull has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is column one. Sometimes, you may want to use columns to display a larger text, so, lets add some <strong>more words</strong>.   Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec mollis. Quisque convallis libero in sapien pharetra tincidunt. Aliquam elit ante, malesuada id, tempor eu, gravida id, odio. Maecenas suscipit, risus et eleifend imperdiet, nisi orci ullamcorper massa, et adipiscing orci velit quis magna. Praesent sit amet ligula id orci venenatis auctor. Phasellus porttitor, metus non tincidunt dapibus, orci pede pretium neque, sit amet adipiscing ipsum lectus et libero. <em>Aenean</em> bibendum. Curabitur mattis quam id urna. Vivamus dui. Donec nonummy lacinia lorem. Cras risus arcu, sodales ac, ultrices ac, mollis quis, justo. Sed a libero. Quisque risus erat, posuere at, tristique non, lacinia quis, eros.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong>Column two.</strong> Cras volutpat, lacus quis semper pharetra, nisi enim dignissim est, et sollicitudin quam ipsum vel mi. Sed commodo urna ac urna. Nullam eu tortor. Curabitur sodales scelerisque magna. Donec ultricies tristique pede. Nullam libero. Nam sollicitudin f<em>elis vel metus. Nullam posuere molestie metus. Nullam molestie, nunc id suscipit rhoncus, felis mi </em>vulputate lacus, a ultrices tortor dolor eget augue. Aenean ultricies felis ut turpis. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Suspendisse placerat tellus ac nulla. Proin adipiscing sem ac risus. Maecenas nisi. Cras semper.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>We can also add blocks inside columns:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list {\"ordered\":true} -->\n<ol><li>This is a numbered list,</li><li>inside a 3 column block</li><li>with a wide alignment.</li></ol>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>The middle column has a paragraph with an image block below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":611} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/canola2.jpg\" alt=\"canola\" class=\"wp-image-611\"/><figcaption>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec mollis. Quisque convallis libero in sapien pharetra tincidunt. Aliquam elit ante, malesuada id, tempor eu, gravida id, odio. Maecenas suscipit, risus et eleifend imperdiet, nisi orci ullamcorper massa, et adipiscing orci velit quis magna.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>-This third column has a quote</p><cite>Theme Reviewer<br></cite></blockquote>\n<!-- /wp:quote --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p><strong>But wait there is more!</strong>&nbsp; We also have a block called <em>Media &amp; Text,</em> which is a two column block that helps you display media and text content next to each other, without having to first setup a column block:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:media-text {\"mediaId\":617,\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc20050813_115856_52.jpg\" alt=\"dsc20050813_115856_52\" class=\"wp-image-617\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\",\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\">Media &amp; Text</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A paragraph block sits ready to be used, below your headline.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'Block: Columns', '', 'publish', 'open', 'open', '', 'column-blocks', '', '', '2018-11-02 12:10:00', '2018-11-02 12:10:00', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1743', 0, 'post', '', 0),
(1784, 1, '2018-11-03 12:25:00', '2018-11-03 12:25:00', '\n    <!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc20050102_192118_51.jpg\",\"align\":\"left\",\"id\":761} -->\n<div class=\"wp-block-cover has-background-dim alignleft\" style=\"background-image:url(http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc20050102_192118_51.jpg)\"><p class=\"wp-block-cover-text\">This is a left aligned cover block with a background image.</p></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>The cover block lets you add text on top of images or videos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This blocktype has several alignment options, and you can also align or center the text inside the block.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The background image can be fixed and you can change its opacity and add an overlay color.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Make sure that the text wraps correctly over the image, and that text markup and alignments are working.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The next image should have a pink overlay color, the text should be bold and aligned to the left:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/canola2.jpg\",\"align\":\"center\",\"contentAlign\":\"left\",\"id\":611,\"overlayColor\":\"pale-pink\"} -->\n<div class=\"wp-block-cover has-pale-pink-background-color has-background-dim has-left-content aligncenter\" style=\"background-image:url(http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/canola2.jpg)\"><p class=\"wp-block-cover-text\"><strong>A center aligned cover image block, with a left aligned text.</strong></p></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc04563.jpg\",\"align\":\"full\",\"id\":759,\"hasParallax\":true,\"dimRatio\":20} -->\n<div class=\"wp-block-cover has-background-dim-20 has-background-dim has-parallax alignfull\" style=\"background-image:url(http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc04563.jpg)\"><p class=\"wp-block-cover-text\">This is a full width cover block with a fixed background image with a 20% opacity.</p></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Make sure that all the text is readable.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc03149.jpg\",\"align\":\"wide\",\"id\":758} -->\n<div class=\"wp-block-cover has-background-dim alignwide\" style=\"background-image:url(http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/dsc03149.jpg)\"><p class=\"wp-block-cover-text\">Our last cover image block has a wide width.</p></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\",\"align\":\"wide\",\"id\":1800,\"backgroundType\":\"video\"} -->\n<div class=\"wp-block-cover has-background-dim alignwide\"><video class=\"wp-block-cover__video-background\" autoplay muted loop src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\"></video><p class=\"wp-block-cover-text\">This is a wide cover block with a video background.</p></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\",\"align\":\"center\",\"id\":1800,\"backgroundType\":\"video\"} -->\n<div class=\"wp-block-cover has-background-dim aligncenter\"><video class=\"wp-block-cover__video-background\" autoplay muted loop src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\"></video><p class=\"wp-block-cover-text\">Compare the video and image blocks.<br>This block is centered.</p></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>The block below has no alignment, and the text is a link. Overlay colors must also work with video backgrounds.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\",\"id\":1800,\"dimRatio\":60,\"customOverlayColor\":\"#f4399d\",\"backgroundType\":\"video\"} -->\n<div class=\"wp-block-cover has-background-dim-60 has-background-dim\" style=\"background-color:#f4399d\"><video class=\"wp-block-cover__video-background\" autoplay muted loop src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2013/12/2014-slider-mobile-behavior.mov\"></video><p class=\"wp-block-cover-text\"><a href=\"https://wordpress.org/gutenberg/\">This page needed more pink</a>. </p></div>\n<!-- /wp:cover -->', 'Block: Cover', '', 'publish', 'open', 'open', '', 'block-cover', '', '', '2018-11-03 12:25:00', '2018-11-03 12:25:00', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1745', 0, 'post', '', 0),
(1785, 1, '2018-11-03 13:20:00', '2018-11-03 13:20:00', '<!-- wp:paragraph -->\n<p>Button blocks are not semantically <em>buttons</em>, but links inside a styled div.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">If you do not add a link, a link tag without an anchor will be used.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"align\":\"left\"} -->\n<div class=\"wp-block-button alignleft\"><a class=\"wp-block-button__link\">Left aligned<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>Check to make sure that the text wraps correctly when the button has more than one line of text, and when it is extra long.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"align\":\"center\"} -->\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\">A centered button with <br>more than <br>one line of text</a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>Buttons have three styles:&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\">Rounded</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\">Outline<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"className\":\"is-style-squared\"} -->\n<div class=\"wp-block-button is-style-squared\"><a class=\"wp-block-button__link\">Square<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>If the theme has a custom color palette, test that background color and text color settings work correctly.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://wordpress.org/gutenberg/handbook/extensibility/theme-support/#block-color-palette\">Read more about the color palettes in the handbook.</a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>Now lets test how buttons display together with large texts.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec mollis. Quisque convallis libero in sapien pharetra tincidunt. Aliquam elit ante, malesuada id, tempor eu, gravida id, odio. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"align\":\"right\"} -->\n<div class=\"wp-block-button alignright\"><a class=\"wp-block-button__link\">Right aligned<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>Maecenas suscipit, risus et eleifend imperdiet, nisi orci ullamcorper massa, et adipiscing orci velit quis magna. Praesent sit amet ligula id orci venenatis auctor. Phasellus porttitor, metus non tincidunt dapibus, orci pede pretium neque, sit amet adipiscing ipsum lectus et libero. Aenean bibendum. Curabitur mattis quam id urna. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"align\":\"left\"} -->\n<div class=\"wp-block-button alignleft\"><a class=\"wp-block-button__link\">Left aligned<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p>Vivamus dui. Donec nonummy lacinia lorem. Cras risus arcu, sodales ac, ultrices ac, mollis quis, justo. Sed a libero. Quisque risus erat, posuere at, tristique non, lacinia quis, eros.</p>\n<!-- /wp:paragraph -->', 'Block: Button', '', 'publish', 'open', 'open', '', 'block-button', '', '', '2018-11-03 13:20:00', '2018-11-03 13:20:00', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1747', 0, 'post', '', 0),
(1786, 1, '2018-11-01 15:28:56', '2018-11-01 15:28:56', '<!-- wp:paragraph -->\n<p>The quote block has two styles,&nbsp;regular:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Gutenberg is more than an editor.</p><cite>The Gutenberg Team<br></cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>and large:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote {\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote is-style-large\"><p>Yes, it is a press, certainly, but a press from which shall flow in inexhaustible streams, the most abundant and most marvelous liquor that has ever flowed to relieve the thirst of men! </p><cite><br><em>Johannes Gutenberg</em><br></cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>The quote blocks themselves have no alignments but the text can be aligned, bold, italic, and linked:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote {\"align\":\"right\",\"className\":\"extraclass\"} -->\n<blockquote class=\"wp-block-quote has-text-align-right extraclass\"><p><strong><em><a href=\"https://developer.wordpress.org/block-editor/developers/themes/theme-support/\">Right</a></em></strong></p><cite>Theme Review<br></cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>In addition to the quote block, we also have the <em>pull quote</em>, with a regular and a solid color style.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You can change the color of the border and the text with the regular style:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote {\"customMainColor\":\"#b80000\",\"textColor\":\"light-gray\"} -->\n<figure class=\"wp-block-pullquote\" style=\"border-color:#b80000\"><blockquote class=\"has-text-color has-light-gray-color\"><p>In addition to the quote block, we also have the pull quote.</p><cite>Theme Reviewer</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:paragraph -->\n<p>Or change the background color and text color with the solid color style:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote {\"mainColor\":\"cyan-bluish-gray\",\"textColor\":\"very-dark-gray\",\"className\":\"has-cyan-bluish-gray-background-color is-style-solid-color\"} -->\n<figure class=\"wp-block-pullquote has-background has-cyan-bluish-gray-background-color is-style-solid-color\"><blockquote class=\"has-text-color has-very-dark-gray-color\"><p>a solid color style</p><cite>Theme Reviewer</cite></blockquote></figure>\n<!-- /wp:pullquote -->', 'Block: Quote', '', 'publish', 'open', 'open', '', 'block-quotes', '', '', '2018-11-01 15:28:56', '2018-11-01 15:28:56', '', 0, 'https://wpthemetestdata.wordpress.com/?p=1749', 0, 'post', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1787, 1, '2018-11-03 03:55:09', '2018-11-03 03:55:09', '<!-- wp:paragraph -->\n<p>Gallery blocks have two settings: the number of columns, and whether or not images should be cropped. The default number of columns is three, and the maximum number of columns is eight.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is a three column gallery at full width, with cropped images.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[],\"linkTo\":\"attachment\",\"className\":\"alignfull\"} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped alignfull\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/canola2/\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/canola2.jpg\" alt=\"canola\" data-id=\"611\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/canola2/\" class=\"wp-image-611\"/></a><figcaption class=\"blocks-gallery-item__caption\">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec mollis. Quisque convallis libero in sapien pharetra tincidunt. Aliquam elit ante, malesuada id, tempor eu, gravida id, odio. Maecenas suscipit, risus et eleifend imperdiet, nisi orci ullamcorper massa, \net adipiscing orci velit quis magna.</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/cep00032/\"><img src=\"http://localhost/job/lth/lth-theme/wp-content/uploads/2008/06/cep00032.jpg\" alt=\"Sunburst Over River\" data-id=\"756\" data-link=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-gallery/cep00032/\" class=\"wp-image-756\"/></a><figcaption class=\"blocks-gallery-item__caption\">Sunburst over the Clinch River, \nSouthwest Virginia.</figcaption></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://wpthemetestdata.wordpress.com/2010/09/10/post-format-galle